import React from "react";
import { Link } from "react-router-dom";

const MatchCard = ({ match }) => {
  return (
    <div className="match-card">
      <h3>{match.sport_event.competitors[0].name} vs {match.sport_event.competitors[1].name}</h3>
      <p>Status: {match.sport_event_status.status}</p>
      <p>Score: {match.sport_event_status.display_score}</p>
      <Link to={`/match/${match.id}`} className="match-link">View Match</Link>
    </div>
  );
};

export default MatchCard;
